export default function PrimarySearchAppBar() {
  const [anchorEl, setAnchorEl] = useState(null);
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const isMobile = useMediaQuery('(max-width:768px)');

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleSearchToggle = () => {
    setIsSearchOpen((prev) => !prev); // Arama çubuğunu aç/kapa yapar
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{ backgroundColor: 'white' }}>
        <Toolbar sx={{ display: 'flex', justifyContent: 'space-between' }}>
          {/* Logo */}
          <Box sx={{ display: 'flex', alignItems: 'center', flexGrow: 1 }}>
            <a href="../Pages/Home">
              <img src={logo} alt="logo" width="200px" height="25px" />
            </a>
          </Box>

          {/* Arama çubuğu ve butonları yan yana hizalama */}
          <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', width: 'auto' }}>
            {/* Arama çubuğu */}
            {isMobile ? (
              <Box sx={{ display: 'flex', alignItems: 'center', width: '100px', backgroundColor: alpha('#000', 0.1), borderRadius: '4px', paddingLeft: '8px' }}>
                {isSearchOpen ? (
                  <StyledInputBase
                    autoFocus
                    placeholder="Ara..."
                    inputProps={{ 'aria-label': 'search' }}
                  />
                ) : (
                  <IconButton onClick={handleSearchToggle} sx={{ color: 'black' }}>
                    <SearchIcon />
                  </IconButton>
                )}
              </Box>
            ) : (
              <Search>
                <SearchIconWrapper>
                  <SearchIcon />
                </SearchIconWrapper>
                <StyledInputBase
                  placeholder="Etkinlik, İş ilanı, Blog ara"
                  inputProps={{ 'aria-label': 'search' }}
                />
              </Search>
            )}

            {/* Sağdaki buton */}
            <Stack spacing={2} direction="row" sx={{ marginLeft: 2 }}>
              <Button variant="text" sx={{ color: 'black' }}>Buton 1</Button>
              <Button variant="text" sx={{ color: 'black' }}>Buton 2</Button>
              <Button variant="text" sx={{ color: 'black' }}>Buton 3</Button>
              <Button variant="outlined" sx={{ color: 'black' }}>Giriş/Üye</Button>
            </Stack>
          </Box>

          {/* Mobil menü - Menü öğeleri */}
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
            anchorOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
            transformOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
          >
            <MenuItem onClick={handleMenuClose}>Buton 1</MenuItem>
            <MenuItem onClick={handleMenuClose}>Buton 2</MenuItem>
            <MenuItem onClick={handleMenuClose}>Buton 3</MenuItem>
            <MenuItem onClick={handleMenuClose}>
              <Button variant="outlined" sx={{ color: 'black' }}>Giriş/Üye</Button>
            </MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
